textOriginal:
@Carlito, eu seguia o Diante do Trono desde o começo de sua carreira. 
Tenho CDS do primeiro ao décimo segundo volume. A partir  quando   a Ana Paula, André e outros foram morar nos Estados Unidos, fiquei tão triste, que fui deixando tipo aquela amizade esfriar. 
E nunca frequentei uma igreja Batista, mas pra mim, eles eram uma referência de cristão pra mim.
